pub fn find_substring(s: String, words: Vec<String>) -> Vec<i32> {
    // sliding window problem

    let search_len = s.len();
    let len = words[0].len();
    let mut out: Vec<i32> = vec![];

    // rotate over the search String
    // while it has valid word continue

    //todo generate the hashmap
    let mut map: HashMap<String, i32> = HashMap::new();

    for word in words {
        let old = map.get(&word).unwrap_or(&0);

        map.insert(word, old + 1);
    }

    for shift in 0..len {
        let mut start = shift;
        let mut end = start;

        let mut remaining_words = map.clone();

        while end + len <= search_len {
            let current_word = &s[end..end + len];

            match remaining_words.get(current_word) {
                None => {
                    if end > start {
                        // slide the search menue
                        let first_word = &s[start..start + len];
                        let val = remaining_words.get(first_word).unwrap_or(&0);
                        remaining_words.insert(first_word.to_string(), val + 1);
                        start += len;
                    } else if end <= start {
                        start += len;
                        end = start;
                    }
                    //
                }
                Some(e) => {
                    if *e > 1 {
                        remaining_words.insert(current_word.to_string(), e - 1);
                        end += len;
                    } else {
                        remaining_words.remove(current_word);
                        end += len;

                        if remaining_words.is_empty() {
                            out.push(start as i32);

                            // todo push the first one to the needed words

                            let first_word = &s[start..start + len];
                            let val = remaining_words.get(first_word).unwrap_or(&0);
                            remaining_words.insert(first_word.to_string(), val + 1);
                            start += len;
                        }
                    }
                }
            }
        }
        //todo travel the trees
    }

    out
}
